import React from 'react';
import './Home.css';
import Navbar from '../Components/Navbar';
import About from '../Pages/About';
import ContactUs from '../Pages/Contact';
import Card from '../Pages/Aridesignscard';

function Home() {
  return (
    <>
      <Navbar />
      <>
        <div className="Home-container">
          <div className="title">
            <h1>Welcome to Our World</h1>
          </div>
          <div className="Home-content">
            <div className="article">
              <h2>Hello! Welcome to Rare Fairy Designs World</h2>
              {/* Animated image */}
              <img src="../Assets/animated-image.webp" alt="Animated" className="animated-image" />
              <p>Discover amazing articles and insights.</p>
              <a href="Register" className="button">Register Now</a>
            </div>
          </div>
        </div>
      </>
      <About />
      <Card />
      <ContactUs />
      {/* <Footer /> */}
    </>
  );
}

export default Home;
